ng data entry for special HTML entities or other characters that require encoding/decoding.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 0, \"length\": 4, \"offset\": 59}], \"inlineStyleRanges\": [{\"style\": \"CODE\", \"length\": 20, \"offset\": 4}, {\"style\": \"CODE\", \"length\": 4, \"offset\": 59}, {\"style\": \"CODE\", \"length\": 1, \"offset\": 98}]}, {\"key\": \"3i46b\", \"data\": {}, \"text\": \"For example, if a user writes Jack & Jill, the text may get encoded as Jack &amp; Jill. Without encodeURIComponent() the ampersand could be interpreted on the server as the start of a new field and jeopardize the integrity of the data.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"CODE\", \"length\": 11, \"offset\": 30}, {\"style\": \"CODE\", \"length\": 15, \"offset\": 71}, {\"style\": \"CODE\", \"length\": 20, \"offset\": 96}]}, {\"key\": \"6u8ol\", \"data\": {}, \"text\": \"For application/x-www-form-urlencoded, spaces are to be replaced by +, so one may wish to follow a encodeURIComponent() replacement with an additional replacement of %20 with +.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 1, \"length\": 33, \"offset\": 4}], \"inlineStyleRanges\": [{\"style\": \"CODE\", \"length\": 33, \"offset\": 4}, {\"style\": \"CODE\", \"length\": 1, \"offset\": 68}, {\"style\": \"CODE\", \"length\": 20, \"offset\": 99}, {\"style\": \"CODE\", \"length\": 3, \"offset\": 166}, {\"style\": \"CODE\", \"length\": 1, \"offset\": 175}]}, {\"key\": \"batsh\", \"data\": {}, \"text\": \"To be more stringent in adhering to RFC 3986 (which reserves !, \', (, ), and *), even though these characters have no formalized URI delimiting uses, the following can be safely used:\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 2, \"length\": 8, \"offset\": 36}], \"inlineStyleRanges\": []}], \"entityMap\": {\"0\": {\"data\": {\"url\": \"https://developer.mozilla.org/en-U