 a catalyst to bring forward the discussion.\", \"type\": \"article\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}], \"entityMap\": {}}',1,0,0,0,0,0,'2021-12-23 12:48:33','2022-01-02 11:20:23',NULL,NULL,NULL,NULL,'2022-01-02 11:20:23','live'),(227,1,'594358d0-63fe-11ec-9947-9c7bef452e53','Before Deploy...ggggg','fhjnxfjxfhmxfhmx\nuse localStorage in order to handle the Authentication. In login function you can set the value of auth state like this localStorage.setItem(\'isAuth\', authenticated). In logout functi','{\"blocks\": [{\"key\": \"696qq\", \"data\": {}, \"text\": \"fhjnxfjxfhmxfhmx\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"vd9\", \"data\": {}, \"text\": \"use localStorage in order to handle the Authentication. In login function you can set the value of auth state like this localStorage.setItem(\'isAuth\', authenticated). In logout function localStorage.removeItem(\'isAuth\'). Change the PrivateRoute as per the localStorage\", \"type\": \"blockquote\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"CODE\", \"length\": 12, \"offset\": 4}, {\"style\": \"CODE\", \"length\": 33, \"offset\": 186}, {\"style\": \"CODE\", \"length\": 12, \"offset\": 256}]}], \"entityMap\": {}}',1,0,0,0,0,0,'2021-12-23 14:41:01','2022-01-02 11:18:28',NULL,NULL,NULL,NULL,'2022-01-02 11:18:28','live'),(228,1,'c960ac10-6402-11ec-9947-9c7bef452e53','Yedidia asked','I am creating a webpage with a few private routes. If the user is not logged in, I want to redirect them to the home page. If the user is logged in, I want to display the page they were originally tr','{\"blocks\": [{\"key\": \"d1vhi\", \"data\": {}, \"text\": \"\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"413u6\", \"data\": {}, \"text\": \"I am creating a webpage with a few private routes. If the user is not logged in, I want to redirect them to the home page. If the user is logged in, I want to display the page they were originally trying to access. The set up I have currently is working for that intended purpose, but whenever a person is on the Private route who is logged in, and then refreshes the page, the private route redirects them to the home page. Unfortunately, my loggedInProvider is running it\'s logged in code AFTER the private route checks the loggedIn boolean and redirects them. SO technically on refresh it is not logging the person in quick enough. Is there a way to wait for the logged in useEffect to run before running the private route code?\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"HIGHLIGHT\", \"length\": 135, \"offset\": 21}]}, {\"key\": \"71nr8\", \"data\": {}, \"text\": \"Here is the useEffect code in my loggedInContext:\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 49, \"offset\": 0}]}, {\"key\": \"8j1vh\", \"data\": {}, \"text\": \"\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"9lmlc\", \"data\": {}, \"text\": \"I am creating a webpage with a few private routes. If the user is not logged in, I want to redirect them to the home page. If the user is logged in, I want to display the page they were originally trying to access. The set up I have currently is working for that intended purpose, but whenever a person is on the Private route who is logged in, and then refreshes the page, the private route redirects them to the home page. Unfortunately, my loggedInProvider is running it\'s logged in code AFTER the private route checks the loggedIn boolean and redirects them. SO technically on refresh it is not logging the person in quick enough. Is there a way to wait for the logged in useEffect to run before running the private route code?\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"HIGHLIGHT\", \"length\": 135, \"offset\": 21}]}, {\"key\": \"1qlkm\", \"data\": {}, \"text\": \"Here is the useEffect code in my loggedInContext:\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 49, \"offset\": 0}]}], \"entityMap\": {}}',1,10,0,0,0,0,'2021-12-23 15:12:47','2022-01-20 14:51:43',NULL,NULL,NULL,NULL,'2022-01-11 13:36:45','live'),(229,1,'35aecf1d-661b-11ec-9947-9c7bef452e53','utydu','jtrjtjjyj','{\"blocks\": [{\"key\": \"crtjg\", \"data\": {}, \"text\": \"jtrjtjjyj\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}], \"entityMap\": {}}',1,0,0,0,0,0,'2021-12-26 07:12:39','2021-12-26 07:37:49',NULL,NULL,NULL,NULL,'2021-12-26 07:37:49','live'),(230,1,'9ea31610-671e-11ec-9947-9c7bef452e53','Dead Publication','A cryptocurrency (or “crypto”) is a form of payment that can circulate without the need for a central monetary authority such as a government or bank. Instead, cryptocurrencies are created using cryptographic techniques that enable people to buy, sell or trade them securely.',NULL,0,0,0,0,0,0,'2021-12-27 14:09:34','2022-01-02 14:09:53',NULL,NULL,NULL,NULL,'2021-12-27 14:09:34','dead'),(231,1,'44913652-671f-11ec-9947-9c7bef452e53','Dead Publication','A cryptocurrency (or “crypto”) is a form of payment that can circulate without the need for a central monetary authority such as a government or bank. Instead, cryptocurrencies are created using cryptographic techniques that enable people to buy, sell or trade them securely.',NULL,1,4,0,0,0,0,'2021-12-27 14:14:13','2022-01-20 08:00:21',NULL,NULL,NULL,NULL,'2021-12-27 14:14:13','dead'),(232,1,'537501ce-67ae-11ec-9947-9c7bef452e53','Intel planning semiconductor manufacturing unit in India as govt rolls out incentives','Chipset maker, Intel, is planning to set up its semiconductor manufacturing unit in India. The US-based chipset giant announcement came in the back drop of recent Union Cabinet’s decision on semiconductors that will encourage research and innovation in the sector and also boost manufacturing, strengthening the \'Aatmanirbhar Bharat\' programme. The Minister for IT and Electronics, Ashwini Vaishnaw, welcomed Intel to India by tweeting. He wrote, “Intel - welcome to India.\"',NULL,0,0,0,0,0,0,'2021-12-28 07:18:16','2022-01-02 14:10:00','Intel Innovation - Keynote','https://www.youtube.com/watch?v=3IZ9fpUUoqc',NULL,NULL,'2021-12-27 22:00:00','dead'),(233,1,'e9de0a56-67ae-11ec-9947-9c7bef452e53','Intel News','Chipset maker, Intel, is planning to set up its semiconductor manufacturing unit in India. The US-based chipset giant announcement came in the back drop of recent Union Cabinet’s decision on semiconductors that will encourage research and innovation in the sector and also boost manufacturing, strengthening the \'Aatmanirbhar Bharat\' programme. The Minister for IT and Electronics, Ashwini Vaishnaw, welcomed Intel to India by tweeting. He wrote, “Intel - welcome to India.\"',NULL,1,0,0,0,0,0,'2021-12-28 07:22:28','2021-12-28 07:22:28','Intel Keynote','https://www.youtube.com/watch?v=3IZ9fpUUoqc',NULL,NULL,'2021-12-27 22:00:00','dead'),(234,1,'202c2ce4-6878-11ec-9947-9c7bef452e53','Omicron','Current knowledge about Omicron \n\nResearchers in South Africa and around the world are conducting studies to better understand many aspects of Omicron and will continue to share the findings of these studies as they become available.  \n\nTransmissibility: It is not yet clear whether Omicron is more transmissible (e.g., more easily spread from person to person) compared to other variants, including Delta. The number of people testing positive has risen in areas of South Africa affected by this var',NULL,1,1,0,0,0,0,'2021-12-29 07:22:48','2022-01-19 15:44:10','','','Omicron reinvented','What Is Cryptocurrency_ Beginners Guide to Digital Cash - NerdWallet_1640762559780.pdf','2021-12-29 07:22:48','dead'),(235,1,'509e8df3-6879-11ec-9947-9c7bef452e53','2021 Office Design Trends','The pandemic has changed the way that both employees and companies approach their office layouts. While many offices had temporary measures in place to ensure health and safety, there are also significant long-term changes that will last even when fears over the pandemic fade.\n\nThe past year has made more people aware of how essential health and safety measures are to protecting our wellbeing. A year of mask wearing, frequent handwashing, and social distancing changed the ways that we view offic',NULL,1,1,0,0,0,0,'2021-12-29 07:31:19','2022-01-20 14:51:41','not empty','https://www.youtube.com/watch?v=3pVXe0hyvpU','','','2022-01-11 14:07:14','dead'),(236,254,'88edb348-6955-11ec-9947-9c7bef452e53','Air Quality In Delhi, Noida Slips To \'Very Poor\'','With the Air Quality Index (AQI) at 328, the air quality in the national capital has again deteriorated to the \'very poor\' category, the System of Air Quality and Weather Forecasting And Research (SAF','{\"blocks\": [{\"key\": \"1l52c\", \"data\": {}, \"text\": \"With the Air Quality Index (AQI) at 328, the air quality in the national capital has again deteriorated to the \'very poor\' category, the System of Air Quality and Weather Forecasting And Research (SAFAR) portal of the Ministry of Earth Sciences reported an air informed on Tuesday.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"2o0oa\", \"data\": {}, \"text\": \"The air quality of the NCR region of Noida has also slipped to the \'very poor\' category. The AQI stands at 333 in the NCR region.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"3ui5p\", \"data\": {}, \"text\": \"Meanwhile, the air quality of Gurugram has improved from \'poor\' to \'moderate\' category with the AQI at 140.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"4723i\", \"data\": {}, \"text\