58}], \"inlineStyleRanges\": []}, {\"key\": \"4i84e\", \"data\": {}, \"text\": \"Critical reception of Rapunzel has been generally positive, with critics complimenting her spirited, lively personality and independence. The tenth Disney Princess, Rapunzel was officially inducted into the line-up on October 2, 2011, becoming the franchise\'s first computer-animated member and the first European princess in 20 years, the last being Belle from Beauty and the Beast (1991). Her appearance and personality have drawn much comparison between her and one of the preceding Disney Princesses, Ariel from The Little Mermaid (1989), by whom she was inspired.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 7, \"length\": 15, \"offset\": 148}, {\"key\": 8, \"length\": 5, \"offset\": 351}, {\"key\": 9, \"length\": 20, \"offset\": 362}, {\"key\": 10, \"length\": 5, \"offset\": 505}, {\"key\": 11, \"length\": 18, \"offset\": 516}], \"inlineStyleRanges\": [{\"style\": \"ITALIC\", \"length\": 20, \"offset\": 362}, {\"style\": \"ITALIC\", \"length\": 18, \"offset\": 516}]}, {\"key\": \"5cmjb\", \"data\": {}, \"text\": \"Contents\", \"type\": \"header-two\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"8efnt\", \"data\": {}, \"text\": \"1Development1.1Conception and writing\\n1.2Voice\\n\\n1.3Personality and design1.3.1Hair\\n\", \"type\": \"unordered-list-item\", \"depth\": 0, \"entityRanges\": [{\"key\": 12, \"length\": 12, \"offset\": 0}, {\"key\": 13, \"length\": 26, \"offset\": 12}, {\"key\": 14, \"length\": 10, \"offset\": 38}, {\"key\": 15, \"length\": 25, \"offset\": 48}, {\"key\": 16, \"length\": 10, \"offset\": 73}], \"inlineStyleRanges\": []}, {\"key\": \"6q5f\", \"data\": {}, \"text\": \"2Appearances\\n2.1Film and television2.1.1Tangled (2010)\\n2.1.2Tangled: Ever After (2012)\\n2.1.3Frozen (2013)\\n2.1.4Sofia the First: The Curse of Princess Ivy (2014)\\n2.1.5Tangled: Before Ever After (2017)\\n2.1.6Rapunzel\'s Tangled Advent