": 3, \"offset\": 111}, {\"key\": 3, \"length\": 3, \"offset\": 114}, {\"key\": 4, \"length\": 8, \"offset\": 293}, {\"key\": 5, \"length\": 6, \"offset\": 337}, {\"key\": 6, \"length\": 3, \"offset\": 519}, {\"key\": 7, \"length\": 3, \"offset\": 522}, {\"key\": 8, \"length\": 3, \"offset\": 525}], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 10, \"offset\": 1}, {\"style\": \"BOLD\", \"length\": 24, \"offset\": 21}]}, {\"key\": \"d998q\", \"data\": {}, \"text\": \"The first literary European version of the story was published in Italy by Giambattista Basile in his Pentamerone in 1634; the version that is now most widely known in the English-speaking world was published in French by Charles Perrault in Histoires ou contes du temps passé in 1697.[6] Another version was later published by the Brothers Grimm in their folk tale collection Grimms\' Fairy Tales in 1812.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 9, \"length\": 19, \"offset\": 75}, {\"key\": 10, \"length\": 11, \"offset\": 102}, {\"key\": 11, \"length\": 16, \"offset\": 222}, {\"key\": 12, \"length\": 34, \"offset\": 242}, {\"key\": 13, \"length\": 3, \"offset\": 285}, {\"key\": 14, \"length\": 14, \"offset\": 332}, {\"key\": 15, \"length\": 19, \"offset\": 377}], \"inlineStyleRanges\": [{\"style\": \"ITALIC\", \"length\": 11, \"offset\": 102}, {\"style\": \"ITALIC\", \"length\": 34, \"offset\": 242}, {\"style\": \"ITALIC\", \"length\": 19, \"offset\": 377}]}, {\"key\": \"6gtp1\", \"data\": {}, \"text\": \"Although the story\'s title and main character\'s name change in different languages, in English-language folklore Cinderella is an archetypal name. The word Cinderella has, by analogy, come to mean one whose attributes were unrecognized: one who unexpectedly achieves recognition or success after a period of obscurity and neglect. The still-popular story of Cinderella continues to influence popular culture internationally, lending plot elements,\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}], \"entityMap\": {\"0\": {\"data\": {\"url\": \"https://en.wikipedia.org/wiki/Cinderella#cite_note-2\", \"href\": \"https://en.wikipedia.org/wiki/Cinderella#cite_note-2\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"1\": {\"data\": {\"url\": \"https://en.wikipedia.org/wiki/Folklore\", \"href\": \"https://en.wikipedia.org/wiki/Folklore\", \"title\": \"Folklore\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"2\": {\"data\": {\"url\": \"https://en.wikipedia.org/wiki/Cinderella#cite_note-Zipes_2001_444-3\", \"href\": \"https://en.wikipedia.org/wiki/Cinderella#cite_note-Zipes_2001_444-3\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"3\": {\"data\": {\"url\": \"https://en.wikipedia.org/wiki/Cinderella#cite_note-Dundes,_Alan_1988-4\", \"href\": \"https://en.wikipedia.org/wiki/Cinderella#cite_note-Dundes,_Alan_1988-4\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"4\": {\"data\": {\"url\": \"https://en.wikipedia.org/wiki/Rhodopis\", \"href\": \"https://en.wikipedia.org/wiki/Rhodopis\", \"title\": \"Rhodopis\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"5\": {\"data\": {\"url\": \"https://en.wikipedia.org/wiki/Strabo\", \"href\": \"https://en.wikipedia.org/wiki/Strabo\", \"title\": \"Strabo\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"6\": {\"data\": {\"url\": \"https://en.wikipedia.org/wiki/Cinderella#cite_note-Zipes_2001_444-3\", \"href\": \"https://en.wikipedia.org/wiki/Cinderella#cite_note-Zipes_2001_444-3\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"7\": {\"data\": {\"url\": \"https://en.wikipedia.org/wiki/Cinderella#cite_note-Dundes,_Alan_1988-4\", \"href\": \"https://en.wikipedia.org/wiki/Cinderella#cite_note-Dundes,_Alan_1988-4\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"8\": {\"data\": {\"url\": \"https://en.wikipedia.org/wiki/Cinderella#cite_note-Green_2011,_chapter_\'\'\'The_Land_of_Egypt\'\'\'-5\", \"href\": \"https: