52e53','The top 7 omicron variant symptoms for children','The omicron variant hasn’t gone away. In fact, the variant has continued to spread across the country, infecting adults and children alike.\nThe news: Emma Duncan, a medical professor at King’s College','{\"blocks\": [{\"key\": \"208fh\", \"data\": {}, \"text\": \"The omicron variant hasn’t gone away. In fact, the variant has continued to spread across the country, infecting adults and children alike.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 0, \"length\": 15, \"offset\": 4}], \"inlineStyleRanges\": []}, {\"key\": \"6ptgh\", \"data\": {}, \"text\": \"The news: Emma Duncan, a medical professor at King’s College London, recently spoke with Insider about the most common omicron variant symptoms for children based on data from the ZOE COVID-19 study, which allows people to report their COVID-19 symptoms.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 1, \"length\": 7, \"offset\": 89}, {\"key\": 2, \"length\": 18, \"offset\": 180}], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 10, \"offset\": 0}]}, {\"key\": \"6jt3d\", \"data\": {}, \"text\": \"The top omicron variant symptoms for children include:\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 3, \"length\": 24, \"offset\": 8}], \"inlineStyleRanges\": []}, {\"key\": \"eu3jf\", \"data\": {}, \"text\": \"Fatigue.\", \"type\": \"ordered-list-item\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 8, \"offset\": 0}]}, {\"key\": \"hllv\", \"data\": {}, \"text\": \"Headache.\", \"type\": \"ordered-list-item\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 9, \"offset\": 0}]}, {\"key\": \"ao0ai\", \"data\": {}, \"text\": \"Sore throat.\", \"type\": \"ordered-list-item\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 12, \"offset\": 0}]}, {\"key\": \"bnft8\", \"data\": {}, \"text\": \"Runny nose.\", \"type\": \"ordered-list-item\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 11, \"offset\": 0}]}, {\"key\": \"909k\", \"data\": {}, \"text\": \"Sneezing.\", \"type\": \"ordered-list-item\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 9, \"offset\": 0}]}, {\"key\": \"acn0m\", \"data\": {}, \"text\": \"Fever.\", \"type\": \"ordered-list-item\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 6, \"offset\": 0}]}, {\"key\": \"7vull\", \"data\": {}, \"text\": \"Cough.\", \"type\": \"ordered-list-item\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 6, \"offset\": 0}]}, {\"key\": \"p5mr\", \"data\": {}, \"text\": \"Extra details: Less common symptoms include intestinal issues, like diarrhea and rashes, Insider reports.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 4, \"length\": 7, \"offset\": 89}], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 15, \"offset\": 0}]}], \"entityMap\": {\"0\": {\"data\": {\"url\": \"https://www.deseret.com/coronavirus/2022/1/19/22891635/omicron-variant-symptom-covid-19-easy-to-miss-headaches\", \"href\": \"https://www.deseret.com/coronavirus/2022/1/19/22891635/omicron-variant-symptom-covid-19-easy-to-miss-headaches\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"1\": {\"data\": {\"url\": \"https://www.businessinsider.com/most-common-symptoms-omicron-children-per-experts-zoe-2022-1\", \"href\": \"https://www.businessinsider.com/most-common-symptoms-omicron-children-per-experts-zoe-2022-1\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"2\": {\"data\": {\"url\": \"https://www.businessinsider.com/uk-half-covid-19-cases-had-vaccine-study-zoe-delta-2021-7\", \"href\": \"https://www.businessinsider.com/uk-half-covid-19-cases-had-vaccine-study-zoe-delta