live'),(365,1,'95594214-7dbd-11ec-8479-9c7bef452e53','What is going on?','Are you ready for the new tags system ?','{\"blocks\": [{\"key\": \"er6g\", \"data\": {}, \"text\": \"Are you ready for the new tags system ?\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}], \"entityMap\": {}}',1,0,0,0,0,0,'2022-01-25 09:02:54','2022-01-25 09:02:54',NULL,NULL,NULL,NULL,'2022-01-25 09:02:54','live'),(366,1,'d9ec7a27-7dbd-11ec-8479-9c7bef452e53','What is going on?','Are you ready for the new tags system ?','{\"blocks\": [{\"key\": \"er6g\", \"data\": {}, \"text\": \"Are you ready for the new tags system ?\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}], \"entityMap\": {}}',1,17,0,0,0,0,'2022-01-25 09:04:50','2022-01-25 12:42:45',NULL,NULL,NULL,NULL,'2022-01-25 09:04:49','live'),(367,1,'387387d1-7dbe-11ec-8479-9c7bef452e53','How is Your Memory?','At this point, psychologists know a lot about the memory. We know the hippocampus, located in the limbic system, is the area of the brain that controls our memories. We know that there are guerilla-me','{\"blocks\": [{\"key\": \"90gcv\", \"data\": {}, \"text\": \"At this point, psychologists know a lot about the memory. We know the hippocampus, located in the limbic system, is the area of the brain that controls our memories. We know that there are guerilla-memory tactics, like acronyms, to enhance our minds’ ability to recall information. If “King Phillip Came Over For Great Spaghetti” wasn’t your saving grace when memorizing the animal kingdom’s classification system, you’re either lying to yourself or maybe you created your own mnemonic device (in which case, please share).\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 0, \"length\": 6, \"offset\": 50}, {\"key\": 1, \"length\": 5, \"offset\": 429}], \"inlineStyleRanges\": []}, {\"key\": \"6tvsl\", \"data\": {}, \"text\": \"But we also know that memory is malleable. And while your memory can at times act as your closest confidant, helping you remember what you need for school and work, it can also Benedict Arnold you. It can convince you that you saw something that wasn’t actually present. It can reconstruct entire scenarios. It’s not that our memories are trying to attract us to the wrong person or make us sound daft when recounting romantic details. Rather, it’s that our memories and strong emotions are inextricably intertwined. One possible reason for our brains’ ability to distort the truth comes from the fact that how we appraise situations in the present often influences how we perceive what happened in the past. This is what psychologists call “mood-congruency”: our current mood determines memory retrieval of a past mood.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}], \"entityMap\": {\"0\": {\"data\": {\"url\": \"https://www.psychologytoday.com/us/basics/memory\", \"href\": \"https://www.psychologytoday.com/us/basics/memory\", \"title\": \"Psychology Today looks at memory\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"1\": {\"data\": {\"url\": \"https://www.psychologytoday.com/us/basics/deception\", \"href\": \"https://www.psychologytoday.com/us/basics/deception\", \"title\": \"Psychology Today looks at lying\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}}}',1,1,0,0,0,0,'2022-01-25 09:07:28','2022-01-25 09:47:51',NULL,NULL,NULL,NULL,'2022-01-25 09:07:28','live'),(368,1,'5c49d084-7dbe-11ec-8479-9c7bef452e53','How about some notifications?','How about some notifications?','{\"blocks\": [{\"key\": \"acuns\", \"data\": {}, \"text\": \"How about some notifications?\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}], \"entityMap\": {}}',1,3,0,0,0,0,'2022-01-25 09:08:28','2022-01-25 11:21:04',NULL,NULL,NULL,NULL,'2022-01-25 09:08:28','live'),(369,1,'df79c067-7dc9-11ec-8479-9c7bef452e53','Al Ha\'Derech','על הדרך הייתה תוכנית טלוויזיה לילדים 