רִים. בנובמבר 2006, רכשה גוגל את החברה תמורת 1.65 מיליארד דולר; מאז, פועלת יוטיוב כאחת מחברות הבת של גוגל.',NULL,1,1,0,0,0,0,'2022-01-25 10:36:10','2022-01-25 12:41:44','youtube guide','https://www.youtube.com/watch?v=shtxwa4CkGo',NULL,NULL,'2022-01-25 10:36:10','dead'),(371,1,'84dd7f07-7dcf-11ec-8479-9c7bef452e53','youtube 2','no description',NULL,1,3,0,0,0,0,'2022-01-25 11:11:18','2022-01-25 11:20:59',NULL,NULL,'title','Payment-Agreement-Template-Signaturely_1643109074775.pdf','2022-01-25 11:11:18','dead'),(372,1,'efae01d9-7dd0-11ec-8479-9c7bef452e53','new publication','neria asked for publication','{\"blocks\": [{\"key\": \"1ej4d\", \"data\": {}, \"text\": \"neria asked for publication\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}], \"entityMap\": {}}',1,0,0,0,0,0,'2022-01-25 11:21:26','2022-01-25 11:21:26',NULL,NULL,NULL,NULL,'2022-01-25 11:21:26','live'),(373,1,'675d296b-7dd1-11ec-8479-9c7bef452e53','lkdvkdvlkdlkj','kkng ;lg;l;l j;jg;;l','{\"blocks\": [{\"key\": \"7ekhv\", \"data\": {}, \"text\": \"kkng ;lg;l;l j;jg;;l\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}], \"entityMap\": {}}',1,0,0,0,0,0,'2022-01-25 11:24:47','2022-01-25 11:24:47',NULL,NULL,NULL,NULL,'2022-01-25 11:24:47','live'),(374,1,'db6e3e9a-7dd1-11ec-8479-9c7bef452e53','mn.cv','h fishkfgk;;',NULL,1,0,0,0,0,0,'2022-01-25 11:28:02','2022-01-25 11:28:02',NULL,NULL,'rwfgg','documentinganexistingapiwithswagger-170203143422_1643110072862.pdf','2022-01-25 11:28:02','dead'),(375,1,'d73e26b3-7dd2-11ec-8479-9c7bef452e53','TEST','Dear Rachel,\nIs it possible to get clarification from the Rav–He seems to be \'retracting\' his statement from earlier this year based on his visit where he got an update that things are looking differe','{\"blocks\": [{\"key\": \"d5cp4\", \"data\": {}, \"text\": \"Dear Rachel,\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"ITALIC\", \"length\": 12, \"offset\": 0}]}, {\"key\": \"e8uph\", \"data\": {}, \"text\": \"Is it possible to get clarification from the Rav–He seems to be \'retracting\' his statement from earlier this year based on his visit where he got an update that things are looking different than what they were looking like before last Rosh Hashanah? A lot of people are asking me too – what should I tell them?\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"ITALIC\", \"length\": 310, \"offset\": 0}]}, {\"key\": \"9230v\", \"data\": {}, \"text\": \"Mashiach Clarified – Rav Shalom Arush – Rebuilding beyond the Rubble.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 0, \"length\": 68, \"offset\": 0}], \"inlineStyleRanges\": [{\"style\": \"ITALIC\", \"length\": 69, \"offset\": 0}, {\"style\": \"UNDERLINE\", \"length\": 68, \"offset\": 0}]}, {\"key\": \"pkqi\", \"data\": {}, \"text\": \"-O.S., Lakewood, NJ, USA\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"ITALIC\", \"length\": 24, \"offset\": 0}]}, {\"key\": \"mkpe\", \"data\": {}, \"text\": \"Regarding Mashiach – tell people to be patient, do teshuva, and pray for ahavat Yisrael, to love everyone! Quote them the famous tzaddik who said, \\\"The Mashiach that\'s coming you don\'t want, and the Mashiach you want – isn\'t coming!\\\"\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 1, \"length\": 14, \"offset\": 73}], \"inlineStyleRanges\": [{\"style\": \"ITALIC\", \"length\": 14, \"offset\": 73}, {\"style\": \"UNDERLINE\", \"length\": 14, \"offset\": 73}]}, {\"key\": \"f9v9t\", \"data\": {}, \"text\": \"We all have been taught all sorts of imaginations of Mashiach, and most of people wanting Mashiach is actually half the problem! \\\"Bring Mashiach now!\\\" essentially tells Hashem, \\\"Do teshuva! Why are You withholding from us the good life?!\\\"\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"c5bti\", \"data\": {}, \"text\": \"Guess what – Hashem wants to bring Mashiach more than we want him! In fact, Rabbi Arush says that Hashem is angry at us for not doing more to improve our spiritual lives and do a daily spiritual accounting, not strengthening our emuna, and especially becoming only more steeped in promiscuity of dress and manner, and increasing the hatred, lashon hara (evil speech), and in-fighting within the Jewish people daily.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 2, \"length\": 26, \"offset\": 179}], \"inlineStyleRanges\": [{\"style\": \"UNDERLINE\", \"length\": 26, \"offset\": 179}, {\"style\": \"ITALIC\", \"length\": 12, \"offset\": 341}]}, {\"key\": \"ad0oj\", \"data\": {}, \"text\": \"So, G-d isn’t bringing Mashiach yet because we aren\'t ready. Rabbi Arush says that if Mashiach comes one second too early – he\'ll come with rivers of blood, G-d forbid.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 124, \"offset\": 44}]}, {\"key\": \"ava41\", \"data\": {}, \"text\": \"If you want Mashiach – stop complaining and get ready! Get rid of all forms of unfiltered Internet. Get rid of the human-hair, custom-made wigs*. Do a real accounting of what you CAN do to slowly increase the holiness in your life on whatever level you’re starting out on.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"acn9h\", \"data\": {}, \"text\": \"Start doing a daily spiritual accounting of at least 30 min so you aren\'t living life as if the world is ownerless and there is no judge and no judgment. Rabbi Arush says that if you truly recognized that there IS a Judge and Judgement, then you wouldn\'t wait for the Judgment to fall on your head! You would repent first! IE every day! And not only do you then stop the Judgment, but you even get a huge reward! If you believed it, you\'d be a fool not to do it. So, you must not REALLY believe that there is a Judge and Judgment…). Start connecting to and listening to tzaddikim like Rabbi Arush, who are going to teach you the real truth!\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"6fu0p\", \"data\": {}, \"text\": \"And of course, Rabbi Arush said the key to the Geula that we’ve all been waiting for is praying 30 minutes a day for ahavat Yisrael. Rabbi Arush says, “Finally, finally we have hope! We have a solution for the problem of baseless hatred that has plagued us for 2,000 years!” Of course, someone who is literally helping to bring the Redemption with mercy will be showered with miracles and everything will be taken care of for him. Rabbi Arush spoke further about our active involvement in bringing Redemption mercifully in his article Will the World Ever Really  Change?.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 3, \"length\": 43, \"offset\": 88}, {\"key\": 4, \"length\": 35, \"offset\": 535}], \"inlineStyleRanges\": [{\"style\": \"UNDERLINE\", \"length\": 43, \"offset\": 88}, {\"style\": \"UNDERLINE\", \"length\": 35, \"offset\": 535}, {\"style\": \"ITALIC\", \"length\": 16, \"offset\": 117}, {\"style\": \"BOLD\", \"length\": 35, \"offset\": 535}]}, {\"key\": \"44g36\", \"data\": {}, \"text\": \"Mashiach is not coming to rid us of all our troubles and let us indulge in more unbridled physicality. Just the opposite – we can enjoy physicality without it harming us only when we are holding on the highest levels of emuna and spirituality! So start investing in what will reap the real dividends!\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 102, \"offset\": 0}]}, {\"key\": \"e3v8b\", \"data\": {}, \"text\": \"We have to at least be willing to WANT to live by the truth and try our best to change slowly – but we can\'t just say, \\\"Oh it\'s fine, Hashem understands.\\\" We just read in Eicha (Lamentations) – “we sinned and did not consider the consequences.”\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 89, \"offset\": 155}, {\"style\": \"ITALIC\", \"length\": 6, \"offset\": 171}, {\"style\": \"ITALIC\", \"length\": 49, \"offset\": 195}]}, {\"key\": \"5o2sf\", \"data\": {}, \"text\": \"Long and wide clothing that doesn\'t cling to or reveal the body, in colors that don\'t attract attention, a real cloth head covering and not a wig, and guarding the eyes aren\'t OPTIONAL. Without them, we negate the most basic aspects of holiness! In fact, I just re-posted a summary from Rabbi Kanievsky shlita\'s book which states that the beard is also a basic part of kedushat Yisrael and all the \\\"heters\\\" to shave purported by the same \\\"Rabbis\\\" who say wigs and the rest of the shebang are all okay are also a sham.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 5, \"length\": 29, \"offset\": 287}], \"inlineStyleRanges\": [{\"style\": \"UNDERLINE\", \"length\": 29, \"offset\": 287}, {\"style\": \"ITALIC\", \"length\": 16, \"offset\": 369}, {\"style\": \"ITALIC\", \"length\": 6, \"offset\": 399}]}, {\"key\": \"9rkas\", \"data\": {}, \"text\": \"This is part of why it is so crucially important to pray every day to come close to a true tzaddik like Rabbi Arush, who teaches the real truth and not the lies. We are literally in the stage of the “birth pangs of Moshiach” and therefore the lies are paraded around as truth, while the truth is trampled upon and mocked - just like the Gemara said it would be. Being connected to tzaddikim and receiving the truth from them, and trying our very best to implement it, is everything! It\'s literally the line between helping to bring Mashiach and delaying him G-d forbid.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 200, \"offset\": 162}, {\"style\": \"ITALIC\", \"length\": 39, \"offset\": 323}]}, {\"key\": \"575vr\", \"data\": {}, \"text\": \"In fact, if I\'m unsure of the truth, that\'s my standard – whatever everyone is saying and doing, the Gemara promises it\'s a lie! And what everyone is mocking, that\'s probably the truth!\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"8uohl\", \"data\": {}, \"text\": \"As someone who knows the truth on many, many subjects from the tzaddikim – I personally testify to you that it\'s an excellent rule to follow on every subject, from Jewish law (halacha) to what is being discussed in the media today!\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"ITALIC\", \"length\": 7, \"offset\": 176}]}, {\"key\": \"669tf\", \"data\": {}, \"text\": \"It was very, VERY hard for me to accept this reality because it\'s scary and painful but when I could finally come to grips with it, I was finally free to live the truth without caring about what other people thought about it!\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"ITALIC\", \"length\": 225, \"offset\": 0}]}, {\"key\": \"8opsa\", \"data\": {}, \"text\": \"“Strength and glory are her clothing, and on the last day – she is the one who will laugh.” King Solomon promises us – on the last day (when one leaves this world and is judged in Heaven, or when Mashiach is fully revealed), who will be the one laughing? (Eshet Chayil).\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"ITALIC\", \"length\": 91, \"offset\": 0}, {\"style\": \"BOLD\", \"length\": 178, \"offset\": 92}]}, {\"key\": \"8nugp\", \"data\": {}, \"text\": \"And who will cower in shame?\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 28, \"offset\": 0}]}, {\"key\": \"brnl\", \"data\": {}, \"text\": \"And which one do I want to be???\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 32, \"offset\": 0}]}, {\"key\": \"aok60\", \"data\": {}, \"text\": \"(*) The synthetic wigs are a real discussion. Many poskim forbid them also because they look far too real, but it is possible to get a heter to wear a synthetic wig under certain circumstances. Even the best ones – generally you can tell that it\'s a wig, versus real hair wigs. Another determining factor is the length – there is NO heter for a long wig (below the shoulders) under any circumstances. Again, generally the synthetic wigs are much shorter.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"81ol5\", \"data\": {}, \"text\": \"That being said, regarding synthetic wigs – there are strong debates between the ikkar hadin – the basic, dry ruling according to Jewish law – and the sod, the ruling according to Kabbalah. Even those who permit synthetic wigs under specific circumstances and many rulings say that synthetic wigs require a specific heter, a specific permission for a specific situation and the average woman does not have blanket permission to use them.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"cbg16\", \"data\": {}, \"text\": \"However, the tzaddikim with ruach hakodesh who rule according to what they see in Heaven and not specifically by halacha, discuss the various punishments meted out to women wearing even synthetic wigs because of the immodesty of attempting to look more beautiful, and specifically unmarried, outside the house! This includes even women who wear a hat on top of the wig which clearly signifies that they are married, women whose wig consists of just a bit of fake hair coming out of a hat, and even some Chassidishe women who wear a scarf, but put a small piece of brown MATERIAL – not even synthetic hair, just brown cloth – to make it look from afar AS IF their hair was showing out the front.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"620ld\", \"data\": {}, \"text\": \"The reason why is that the entire idea is incorrect. A married woman showing hair is forbidden. There is also a law that says that you are not allowed to do anything that even LOOKS forbidden. Hence, the Gemara says that almond milk served at a meat meal must have almonds in it to prove it isn\'t dairy! In our days people assume it\'s non-dairy milk but when that was rare, it had to be proven. And here a woman is going OUT OF HER WAY to look as if she\'s doing something forbidden?! And often in order to look more beautiful or more \\\"normal\\\" outside of the house, which is also against the principles of modesty – and sometimes even to fit in among the non-Jews easier and not be easily identified as a Jew, which is also against the principles of holiness!\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"fh78r\", \"data\": {}, \"text\": \"***\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 3, \"offset\": 0}]}, {\"key\": \"ahr8g\", \"data\": {}, \"text\": \"Rachel Avrahami grew up in Los Angeles, CA, USA in a far-off valley where she was one of only a handful of Jews in a public high school of thousands. She found Hashem in the urban jungle of university. Rachel was privileged to read one of the first copies of The Garden of Emuna in English, and the rest, as they say, is history. She made Aliyah and immediately began working at Breslev Israel.  \\n \\nRachel is now the Editor of Breslev Israel\'s English website. She welcomes questions, comments, articles, and personal stories to her email:  rachel.avrahami@breslev.co.il.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 6, \"length\": 19, \"offset\": 259}], \"inlineStyleRanges\": [{\"style\": \"ITALIC\", \"length\": 395, \"offset\": 0}, {\"style\": \"ITALIC\", \"length\": 172, \"offset\": 399}, {\"style\": \"UNDERLINE\", \"length\": 19, \"offset\": 259}, {\"style\": \"UNDERLINE\", \"length\": 29, \"offset\": 541}]}], \"entityMap\": {\"0\": {\"data\": {\"rel\": \"noreferrer noopener\", \"url\": \"https://www.breslev.co.il/vod/questions_and_answers/questions_and_answers/rav_arush_q_a_in_english_build_beyond_the_rubble.aspx?id=10498&language=english\", \"href\": \"https://www.breslev.co.il/vod/questions_and_answers/questions_and_answers/rav_arush_q_a_in_english_build_beyond_the_rubble.aspx?id=10498&language=english\", \"target\": \"_blank\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"1\": {\"data\": {\"rel\": \"noreferrer noopener\", \"url\": \"https://www.breslev.co.il/categories/foundations_of_judaism/jewish_outlook/its_time_to_love_each_other.aspx?category=35&chapter=524&pageid=1&language=english\", \"href\": \"https://www.breslev.co.il/categories/foundations_of_judaism/jewish_outlook/its_time_to_love_each_other.aspx?category=35&chapter=524&pageid=1&language=english\", \"target\": \"_blank\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"2\": {\"data\": {\"rel\": \"noreferrer noopener\", \"url\": \"https://www.breslev.co.il/articles/spirituality_and_faith/spiritual_growth/repentance_rehab.aspx?id=36374&language=english\", \"href\": \"https://www.breslev.co.il/articles/spirituality_and_faith/spiritual_growth/repentance_rehab.aspx?id=36374&language=english\", \"target\": \"_blank\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"3\": {\"data\": {\"rel\": \"noreferrer noopener\", \"url\": \"https://www.breslev.co.il/articles/news_and_updates/news/stop_the_tragedies.aspx?id=37477&language=english\", \"href\": \"https://www.breslev.co.il/articles/news_and_updates/news/stop_the_tragedies.aspx?id=37477&language=english\", \"target\": \"_blank\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"4\": {\"data\": {\"rel\": \"noreferrer noopener\", \"url\": \"https://www.breslev.co.il/articles/foundations_of_judaism/jewish_outlook/will_the_world_ever_really_change.aspx?id=37545&language=english\", \"href\": \"https://www.breslev.co.il/articles/foundations_of_judaism/jewish_outlook/will_the_world_ever_really_change.aspx?id=37545&language=english\", \"target\": \"_blank\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"5\": {\"data\": {\"rel\": \"noreferrer noopener\", \"url\": \"https://www.breslev.co.il/articles/foundations_of_judaism/jewish_daily_life_and_halacha/the_truth_from_rabbi_kanievsky.aspx?id=37518&language=english\", \"href\": \"https://www.breslev.co.il/articles/foundations_of_judaism/jewish_daily_life_and_halacha/the_truth_from_rabbi_kanievsky.aspx?id=37518&language=english\", \"target\": \"_blank\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"6\": {\"data\": {\"rel\": \"noreferrer noopener\", \"url\": \"https://www.breslev.co.il/store/the_garden_of_emuna_new_and_expanded_edition_english/spirituality_and_faith/books.aspx?id=2433&language=english\", \"href\": \"https://www.breslev.co.il/store/the_garden_of_emuna_new_and_expanded_edition_english/spirituality_and_faith/books.aspx?id=2433&language=english\", \"target\": \"_blank\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}}}',1,34,0,0,0,0,'2022-01-25 11:35:04','2022-01-25 14:50:22',NULL,NULL,NULL,NULL,'2022-01-25 11:35:04','live'),(376,1,'18d0264f-7dd4-11ec-8479-9c7bef452e53','dgzt','thyfgyjyj','{\"blocks\": [{\"key\": \"akvsr\", \"data\": {}, \"text\": \"thyfgyjyj\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}], \"entityMap\": {}}',1,2,0,0,0,0,'2022-01-25 11:44:04','2022-01-25 12:19:32',NULL,NULL,NULL,NULL,'2022-01-25 11:44:04','live'),(377,1,'1dd7ba30-7dd5-11ec-8479-9c7bef452e53','Reponsel shes have to long hair. she have to cut','asd alsiodyh sdhasd jasd lahs