th\": 7, \"offset\": 71}, {\"key\": 3, \"length\": 6, \"offset\": 89}, {\"key\": 4, \"length\": 8, \"offset\": 110}, {\"key\": 5, \"length\": 6, \"offset\": 133}, {\"key\": 6, \"length\": 3, \"offset\": 154}, {\"key\": 7, \"length\": 3, \"offset\": 175}], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 11, \"offset\": 20}]}, {\"key\": \"bfigd\", \"data\": {}, \"text\": \"The golden hour is also sometimes called the \\\"magic hour,\\\" especially by cinematographers.[1][2] During these times, the brightness of the sky matches the brightness of streetlights, signs, car headlights and lit windows.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 8, \"length\": 3, \"offset\": 90}, {\"key\": 9, \"length\": 3, \"offset\": 93}], \"inlineStyleRanges\": []}, {\"key\": \"4bu4\", \"data\": {}, \"text\": \"The period of time shortly before the magic hour at sunrise, or after it at sunset, is called the \\\"blue hour\\\". This is when the sun is at a significant depth below the horizon, when residual, indirect sunlight takes on a predominantly blue shade, and there are no sharp shadows because the sun either has not risen, or has set.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 10, \"length\": 9, \"offset\": 99}], \"inlineStyleRanges\": []}], \"entityMap\": {\"0\": {\"data\": {\"url\": \"https://en.wikipedia.org/wiki/Photography\", \"href\": \"https://en.wikipedia.org/wiki/Photography\", \"title\": \"Photography\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"1\": {\"data\": {\"url\": \"https://en.wikipedia.org/wiki/Daytime\", \"href\": \"https://en.wikipedia.org/wiki/Daytime\", \"title\": \"Daytime\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"2\": {\"data\": {\"url\": \"https://en.wikipedia.org/wiki/Sunrise\", \"href\": \"https://en.wikipedia.org/wiki/Sunrise\", \"title\": \"Sunrise\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"3\": {\"data\": {\"url\": \"https://en.wikipedia.org/wiki/Sunset\", \"href\": \"https://en.wikipedia.org/wiki/Sunset\", \"title\": \"Sunset\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"4\": {\"data\": {\"url\": \"https://en.wikipedia.org/wiki/Daylight\", \"href\": \"https://en.wikipedia.org/wiki/Daylight\", \"title\": \"Daylight\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"5\": {\"data\": {\"url\": \"https://en.wikipedia.org/wiki/Hard_and_soft_light\", \"href\": \"https://en.wikipedia.org/wiki/Hard_and_soft_light\", \"title\": \"Hard and soft light\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"6\": {\"data\": {\"url\": \"https://en.wikipedia.org/wiki/Sun\", \"href\": \"https://en.wikipedia.org/wiki/Sun\", \"title\": \"Sun\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"7\": {\"data\": {\"url\": \"https://en.wikipedia.org/wiki/Sky\", \"href\": \"https://en.wikipedia.org/wiki/Sky\", \"title\": \"Sky\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"8\": {\"data\": {\"url\": \"https://en.wikipedia.org/wiki/Golden_hour_(photography)#cite_note-1\", \"href\": \"https://en.wikipedia.org/wiki/Golden_hour_(photography)#cite_note-1\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"9\": {\"data\": {\"url\": \"https://en.wikipedia.org/wiki/Golden_hour_(photography)#cite_note-2\", \"href\": \"https://en.wikipedia.org/wiki/Golden_hour_(photography)#cite_note-2\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"10\": {\"data\": {\"url\": \"https://en.wikipedia.org/wiki/Blue_hour\", \"href\": \"https://en.wikipedia.org/wiki/Blue_hour\", \"title\": \"Blue hour\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}}}',1,13,0,0,0,0,'2022-01-27 15:18:32','2022-01-30 15:41:26',NULL,NULL,NULL,NULL,'2022-01-27 15:18:32','live'),(449,1,'904cf13b-7f84-11ec-8479-9c7bef452e53','Saga','Sagas are prose stories and histories, composed in Iceland and to a lesser extent elsewhere in Scandinavia.\nThe most famous saga-genre is the Íslendingasögur (sagas concerning Icelanders), which featu','{\"blocks\": [{\"key\": \"8g77l\", \"data\": {}, \"text\": \"Sagas are prose stories and histories, composed in Iceland and to a lesser extent elsewhere in Scandinavia.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 0, \"length\": 5, \"offset\": 10}, {\"key\": 1, \"length\": 7, \"offset\": 51}, {\"key\": 2, \"length\": 11, \"offset\": 95}], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 5, \"offset\": 0}]}, {\"key\": \"2g247\", \"data\": {}, \"text\": \"The most famous saga-genre is the Íslendingasögur (sagas concerning Icelanders), which feature Viking voyages, migration to Iceland, and feuds between Icelandic families. However, sagas\' subject matter is diverse, including pre-Christian Scandinavian legends; saints and bishops both from Scandinavia and elsewhere; Scandinavian kings and contemporary Icelandic politics; and chivalric romances either translated from Continental European languages or composed locally.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 3, \"length\": 15, \"offset\": 34}, {\"key\": 4, \"length\": 6, \"offset\": 95}, {\"key\": 5, \"length\": 5, \"offset\": 137}, {\"key\": 6, \"length\": 34, \"offset\": 224}, {\"key\": 7, \"length\": 6, \"offset\": 260}, {\"key\": 8, \"length\": 7, \"offset\": 271}, {\"key\": 9, \"length\": 18, \"offset\": 316}, {\"key\": 10, \"length\": 31, \"offset\": 339}, {\"key\": 11, \"length\": 18, \"offset\": 376}], \"inlineStyleRanges\": [{\"style\": \"ITALIC\", \"length\": 15, \"offset\": 34}]}, {\"key\": \"2sjt9\", \"data\": {}, \"text\": \"Sagas originated in the Middle Ages, but continued to be composed in the ensuing centuries. Whereas the dominant language of history-writing in medieval Europe was Latin, sagas were composed in the vernacular: Old Norse and its later descendants, primarily Icelandic.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 12, \"length\": 5, \"offset\": 164}, {\"key\": 13, \"length\": 9, \"offset\": 210}, {\"key\": 14, \"length\