0 13:12:44','live'),(455,1,'ceb643da-81e5-11ec-8479-9c7bef452e53','Before The Storm - A Very Long Title for Once','Life Is Strange: Before the Storm is an episodic graphic adventure video game developed by Deck Nine and published by Square Enix\'s European subsidiary. The three episodes were released for Microsoft','{\"blocks\": [{\"key\": \"98gd6\", \"data\": {}, \"text\": \"Life Is Strange: Before the Storm is an episodic graphic adventure video game developed by Deck Nine and published by Square Enix\'s European subsidiary. The three episodes were released for Microsoft Windows, PlayStation 4, and Xbox One in late 2017 and the bonus episode was released for Deluxe Edition owners in March 2018. It is the second entry in the Life Is Strange series, set as a prequel to the original game, focusing on sixteen-year-old Chloe Price and her relationship with schoolmate Rachel Amber. Gameplay concerns itself mostly with the use of branching dialogues and interacting with the environment. It was ported to Linux, macOS, Android, and iOS in late 2018.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 0, \"length\": 28, \"offset\": 49}, {\"key\": 1, \"length\": 9, \"offset\": 91}, {\"key\": 2, \"length\": 11, \"offset\": 118}, {\"key\": 3, \"length\": 19, \"offset\": 132}, {\"key\": 4, \"length\": 17, \"offset\": 190}, {\"key\": 5, \"length\": 13, \"offset\": 209}, {\"key\": 6, \"length\": 8, \"offset\": 228}, {\"key\": 7, \"length\": 22, \"offset\": 356}, {\"key\": 8, \"length\": 11, \"offset\": 448}, {\"key\": 9, \"length\": 19, \"offset\": 559}, {\"key\": 10, \"length\": 5, \"offset\": 634}, {\"key\": 11, \"length\": 5, \"offset\": 641}, {\"key\": 12, \"length\": 7, \"offset\": 648}, {\"key\": 13, \"length\": 3, \"offset\": 661}], \"inlineStyleRanges\": [{\"style\": \"ITALIC\", \"length\": 33, \"offset\": 0}, {\"style\": \"ITALIC\", \"length\": 15, \"offset\": 356}, {\"style\": \"BOLD\", \"length\": 33, \"offset\": 0}]}, {\"key\": \"8d66m\", \"data\": {}, \"text\": \"Deck Nine began developing the game in 2016, using the Unity game engine. Ashly Burch from the original game did not voice Chloe Price in Before the Storm because of the SAG-AFTRA strike, but reprised her role in a bonus episode once the strike was resolved. British indie band Daughter wrote and performed the score. Life Is Strange: Before the Storm received generally favourable reviews, praising the characters, themes, and story, while criticising aspects like plotholes, the main relationship, and the impact of player decisions near the end of the game.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 14, \"length\": 5, \"offset\": 55}, {\"key\": 15, \"length\": 11, \"offset\": 74}, {\"key\": 16, \"length\": 16, \"offset\": 170}, {\"key\": 17, \"length\": 8, \"offset\": 278}], \"inlineStyleRanges\": [{\"style\": \"ITALIC\", \"length\": 16, \"offset\": 138}, {\"style\": \"ITALIC\", \"length\": 33, \"offset\": 318}]}, {\"key\": \"4jnms\", \"data\": {}, \"text\": \"A remastered version of the game will be released as part of the Life Is Strange Remastered Collection in early 2022.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 18, \"length\": 37, \"offset\": 65}], \"inlineStyleRanges\": [{\"style\": \"ITALIC\", \"length\": 37, \"offset\": 65}]}], \"entityMap\": {\"0\": {\"data\": {\"url\": \"https://en.wikipedia.org/wiki/Graphic_adventure_video_game\", \"href\": \"https://en.wikipedia.org/wiki/Graphic_adventure_video_game\", \"title\": \"Graphic adventure video game\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"1\": {\"data\": {\"url\": \"https://en.wikipedia.org/wiki/Deck_Nine\", \"href\": \"https://en.wikipedia.org/wiki/Deck_Nine\", \"title\": \"Deck Nine\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"2\": {\"data\": {\"url\": \"https://en.wikipedia.org/wiki/Square_Enix\", \"href\": \"https://en.wikipedia.org/wiki/Square_Enix\", \"title\": \"Square Enix\"}, \"type\": \"LINK\", \"mutability